import Sidebar from "../../../components/Sidebar/Sidebar";

export default function Home() {
    return (
        <>
        <Sidebar pages={ManagerTabs} current={'Workshop'} />
            <div className='workshop'>
                <PageHead title={'Workshop'} />
            </div>
        </>
    )
}
